import React, {Component} from 'react';
 import './App.css';

class Header extends Component {
    render() {
        return (
            <div className='header.modul'>
                <img src='https://cdn.auth0.com/blog/react-redux/logo.png'/>

            </div>

        );
    }
}
export default Header
